import 'bootstrap/dist/css/bootstrap.css'; 
import Container from "react-bootstrap/Container"

const MainBoard = () => {
    return (  
        <Container style={{ backgroundColor: '#6f42c1'}} > 
            <h3>Sample Text, Greetings from GeeksforGeeks</h3> 
        </Container> 
    ); 
}

